import React from 'react';
import {Routes,Route} from 'react-router-dom';
import { useDispatch } from 'react-redux';
import Home from './components/routes/home/Home';
import Editor from './components/routes/editor/Editor.jsx';
import Navigation from './components/routes/navigation/Navigation';
import { createUserDocumentFromAuth } from './components/util/firebase/Firebase';
import { useEffect } from "react";
import { onAuthStateChangedListener } from '../src/components/util/firebase/Firebase.jsx';
import {setCurrentUser} from '../src/components/store/user/UserAction';
import FrontPage from './components/routes/frontPage/FrontPage';

function App(props) {
  const dispatch = useDispatch();
  useEffect(() => {
    const unsubscribe = onAuthStateChangedListener((user) => {
      if (user) {
        createUserDocumentFromAuth(user);
      }

      dispatch(setCurrentUser(user));
    });

    return unsubscribe;
  }, [dispatch]);
  return (
    <Routes>
      <Route path='/' element={<Navigation/>}>
      <Route index element={<FrontPage/>}/>
      <Route path='details' element={<FrontPage/>}/>
      <Route path='home' element={<Home/>}/>
      <Route path='editor' element={<Editor/>}/>
      </Route>
    </Routes>
  );
}

export default App;
